          <button type="button" onClick={onClose} className="popup__close popup__close_img"></button>
          <img className="popup__full-img" src="#" alt="#"/>
          <h2 className="popup__name">
          </h2>
        </div>
      </div>
    )
}

export default ImagePopup;
